import React from 'react';
import './Account.css';

const Account = ({ user }) => {
  return (
      <div className="card">
        <h2 className="title">Account Details</h2>
        <div className="details">
          <div><b>Name:</b> {user.name}</div>
          <div><b>Email:</b> {user.email}</div>
          <div><b>Phone:</b> {user.phone}</div>
        </div>
      </div>
  );
};

export default Account;
